import {useState} from 'react'
import Header from './Header'
import Axios from 'axios';
export default function Chose(props){
    [row,setRow]=useState()
    if(!props.authorized){
        return <Redirect to="/"/>
    }
    Axios.get("http://localhost:3002/api/get").then((response)=>console.log(response))
    
    return (
    <>
    <Header/>
    
    <table>
        <tr>
            <th></th>
        </tr>
    </table>
    
    </>
    )
}
